String pathInfo = request.getPathInfo();
if (pathInfo == null)
    pathInfo = "/";
return pathInfo;

String pathInfo = request.getPathInfo();
if (pathInfo.startsWith("/"))
{
    pathInfo = pathInfo.substring(1);
}
return pathInfo;

String pathInfo = request.getPathInfo();
if (pathInfo != null) {
    return pathInfo;
} else {
    return "";
}

String pathInfo = request.getPathInfo();
if( pathInfo == null )
    pathInfo = "/";
return pathInfo;

String pathInfo = request.getPathInfo(); 
// return pathInfo;
return pathInfo.replaceFirst( "/", "" );

